Information
------------------------------

Monumental Mysteries: A Mystery at the Museum Special
Don Wildman investigates a statue that has earned a grisly reputation, a tribute to a revered leader that some say is a symbol of evil and famous carvings that are rumoured to hide a secret vault. An actress stands in front of the Hollywood sign in Hollywood, CA. The sign looms high over the city of Los Angeles and is an iconic symbol of glitz and glamour. But there are some who claim that these 9 letters are haunted. So, what tragic event spawned these rumours?
Also in a quiet, Washington, DC, courtyard is a mysterious bronze sculpture that depicts a mournful woman draped with a cloak. This figure is rumoured to have caused pregnant women to miscarry and is even reported to have caused the death of a college student.
Standing in the middle of the National Mall in the nation's capital is the Washington Monument - a 555-foot marble tower celebrating the country's first president. But many people say it's the creation of a secret society determined to take over the world. So, is this striking memorial really a symbol of evil?
On a hill outside of the small town of Elberton, GA, is one of the nation's most peculiar monuments - a collection of 6 stones, engraved with cryptic messages, in a dozen languages. What do they say? And what is their purpose?

